import request from '@/utils/request'
/**
 *
 * 设备管理
 *
 **/

 // 设备分页列表
export const getDeviceList = (params: any) => {
  return request({
    url: '/it_manager/devicePage',
    method: 'get',
    params
  })
}

// 查看详情根据id
export const queryDeviceById = (id: string | (string | null)[]) => {
    return request({
      url: `/it_manager/device/${id}`,
      method: 'get'
    })
  }

  // 设备履历分页列表
export const getDeviceResumeList = (params: any) => {
    return request({
      url: '/it_manager/deviceResumePage',
      method: 'get',
      params
    })
  }
  
  // 查看详情根据id
  export const queryDeviceResumeById = (id: string | (string | null)[]) => {
      return request({
        url: `/it_manager/deviceResume/${id}`,
        method: 'get'
      })
    }
